import React, {Component} from 'react';
import {Form, Input, Label, Button, Row, Col} from 'reactstrap';
import "../center.css";

class SignIn extends Component {

  render(){
    return(
      <Row>
        <Col>
          <div style={center}>
            <Label>Username:</Label>
            <Input type='text'/>
            <Label>Password:</Label>
            <Input type='text'/>
          </div>
        </Col>
      </Row>
    );
  }

}

export default SignIn;
